<script>
  // Function to decode Base64 and parse query params
  function getDecodedParams() {
    const params = new URLSearchParams(window.location.search);
    const encodedData = params.get('data');
    console.log(encodedData)
    
    if (!encodedData) return {};

    // Decode base64 and parse JSON
    const decodedString = atob(encodedData);
    return JSON.parse(decodedString);
  }

  // Populate fields based on decoded query params
  function populateFields() {
    const queryParams = getDecodedParams();
    
    console.log(queryParams)
    if (queryParams.sanctionedAmount) {
      document.getElementById('sanctionedAmount').textContent = queryParams.sanctionedAmount;
      console.log(queryParams, "asdasdas")
    }
    if (queryParams.tenure) {
      document.getElementById('tenure').textContent = queryParams.tenure;
    }
    if (queryParams.tenure) {
      document.getElementById('tenure2').textContent = queryParams.tenure;
    }
    if (queryParams.emiAmount) {
      document.getElementById('emiAmount').textContent = queryParams.emiAmount;
    }
    if (queryParams.aprPercentage) {
      document.getElementById('aprPercentage').textContent = queryParams.aprPercentage + "%";
    }
    if (queryParams.emiAmount) {
      document.getElementById('emiAmount2').textContent = queryParams.emiAmount;
    }
    if (queryParams.aprPercentage) {
      document.getElementById('aprPercentage2').textContent = queryParams.aprPercentage;
    }
    if(queryParams.acceptedTotalAmount) {
      document.getElementById('acceptedTotalAmount').textContent = queryParams.acceptedTotalAmount
    }
    if(queryParams.newappliedinterest)     {
      document.getElementById('newappliedinterest').textContent = queryParams.newappliedinterest
    }
    if(queryParams.totalpayingAmount) {
      document.getElementById('totalpayingAmount').textContent = queryParams.totalpayingAmount
    }
    if(queryParams.repaymentSchedule) {
      console.log(queryParams.repaymentSchedule)
      queryParams.repaymentSchedule.forEach((schedule, index) => {
            addRow('svgTable', schedule, 40 + (index * 20));
        });
    }
  }

  function addRow(svgId, schedule, yPosition) {
    const svg = document.getElementById(svgId).querySelector('g#table');
    console.log(svg, "loaded")
    const row = document.createElementNS('http://www.w3.org/2000/svg', 'text');
    row.setAttribute('x', '10');
    row.setAttribute('y', yPosition);
    row.setAttribute('style', 'font-family: Arial; font-size: 12px;');

    // Create tspan elements for each column
    const srNo = document.createElementNS('http://www.w3.org/2000/svg', 'tspan');
    srNo.setAttribute('x', '10');
    srNo.textContent = schedule.srNo;

    const emiDate = document.createElementNS('http://www.w3.org/2000/svg', 'tspan');
    emiDate.setAttribute('x', '60');
    emiDate.textContent = schedule.emiDate;

    const openingBalance = document.createElementNS('http://www.w3.org/2000/svg', 'tspan');
    openingBalance.setAttribute('x', '160');
    openingBalance.textContent = schedule.openingBalance;

    const emi = document.createElementNS('http://www.w3.org/2000/svg', 'tspan');
    emi.setAttribute('x', '300');
    emi.textContent = schedule.emi;

    const interestComponent = document.createElementNS('http://www.w3.org/2000/svg', 'tspan');
    interestComponent.setAttribute('x', '400');
    interestComponent.textContent = schedule.interestComponent;

    const principalComponent = document.createElementNS('http://www.w3.org/2000/svg', 'tspan');
    principalComponent.setAttribute('x', '500');
    principalComponent.textContent = schedule.principalComponent;

    const closingBalance = document.createElementNS('http://www.w3.org/2000/svg', 'tspan');
    closingBalance.setAttribute('x', '600');
    closingBalance.textContent = schedule.closingBalance;

    // Append tspans to the row
    row.appendChild(srNo);
    row.appendChild(emiDate);
    row.appendChild(openingBalance);
    row.appendChild(emi);
    row.appendChild(interestComponent);
    row.appendChild(principalComponent);
    row.appendChild(closingBalance);

    // Add row to the table group in the specific SVG
    svg.appendChild(row);
}

  // Run the function on page load
  window.onload = populateFields;
</script>
